import { GitHub } from "@material-ui/icons";
import MailOutlineIcon from '@material-ui/icons/MailOutline';
import { mdiLanguageTypescript } from '@mdi/js';
import Icon from '@mdi/react'


const links = [
  {
    label: 'Github',
    link: 'https://github.com/jswelsh',
    icon: <GitHub />
  },
  {
    label: 'Email',
    link: 'mailto:james.sinclair.welsh@gmail.com',
    icon: <MailOutlineIcon/>
  }
]

const projects = [
  {
  header: 'CurExC',
  link: 'https://curexc.web.app/',
  technologies: [{
      label:'React',
      icon: null
    }, {
      label: 'Material UI', 
      icon: null
    }, {
      label:'TypeScript',
      icon: <Icon size={.80} path={mdiLanguageTypescript} />
    }
  ],
  image: null
}];
export { links, projects }
